webpackJsonp([78674846518818],{7745:function(e,t){e.exports={data:{post:{html:'<p>My boss had some problems <a href="http://sibylle.blogg.de/eintrag.php?id=432">creating a Advent calendar</a> for his daughter, but luckily <a href="http://greenhaddock2.blogspot.com/2006/12/1st-advent.html">Green Haddock has a calendar</a> that anyone (even men) can put together. It\'s so beautiful, though, you probably won\'t want to give it away. Happy Advent!</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/12/bitburger_advent_calendar.jpg" alt="Bitburger Advent Calendar" title="Bitburger Advent Calendar" /></p>\n<p>Tip: if you use the 30-pack of Astra Urtyp, you can enjoy your calendar for nearly a week longer!</p>',fields:{title:"Do-It-Yourself Advent Calendar",date:"03 Dec 2006",url:"https://papascott.de/2006-12-03-do-it-yourself-advent-calendar/"}}},pathContext:{slug:"/2006-12-03-do-it-yourself-advent-calendar/",prev:{fields:{title:"Christmas Market Monday",date:"03 Dec 2006",slug:"/2006-12-03-christmas-market-monday/"}},next:{fields:{title:"Ronald Schill, please come home!",date:"03 Dec 2006",slug:"/2006-12-03-ronald-schill-please-come-home/"}}}}}});
